// src/pages/member/MemberDashboard.js
import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const MemberDashboard = () => {
  const navigate = useNavigate();
  const [stats, setStats] = useState({
    monthlyContribution: 5000,
    totalPaid: 45000,
    pendingAmount: 5000,
    lastPaymentDate: '1/10/2025',
    myComplaints: 3,
    unreadNotifications: 5
  });
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    setLoading(true);
    setTimeout(() => {
      setStats({
        monthlyContribution: 5000,
        totalPaid: 45000,
        pendingAmount: 5000,
        lastPaymentDate: '1/10/2025',
        myComplaints: 3,
        unreadNotifications: 5
      });
      setLoading(false);
    }, 1000);
  }, []);

  const handleViewExpenses = () => {
    navigate('/member/expenses');
  };

  const handleViewComplaints = () => {
    navigate('/member/complaints');
  };

  const handleViewNotifications = () => {
    navigate('/member/notifications');
  };

  const formatAmount = (amount) => {
    return new Intl.NumberFormat('en-IN', {
      style: 'currency',
      currency: 'INR',
      minimumFractionDigits: 0
    }).format(amount);
  };

  const styles = {
    dashboard: {
      padding: '20px',
      maxWidth: '1200px',
      margin: '0 auto',
      fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif"
    },
    header: {
      marginBottom: '20px'
    },
    headerTitle: {
      fontSize: '32px',
      color: '#2c3e50',
      margin: '0 0 8px 0'
    },
    headerSubtitle: {
      fontSize: '16px',
      color: '#7f8c8d',
      margin: '0'
    },
    welcomeSection: {
      marginBottom: '30px'
    },
    welcomeTitle: {
      fontSize: '24px',
      color: '#2c3e50',
      margin: '0 0 8px 0'
    },
    welcomeText: {
      fontSize: '16px',
      color: '#7f8c8d',
      margin: '0'
    },
    loadingContainer: {
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      height: '200px'
    },
    spinner: {
      border: '4px solid rgba(0, 0, 0, 0.1)',
      borderRadius: '50%',
      borderTop: '4px solid #3b82f6',
      width: '40px',
      height: '40px',
      animation: 'spin 1s linear infinite'
    },
    cardsGrid: {
      display: 'grid',
      gridTemplateColumns: 'repeat(auto-fit, minmax(280px, 1fr))',
      gap: '20px',
      marginBottom: '30px'
    },
    card: {
      backgroundColor: 'white',
      borderRadius: '12px',
      boxShadow: '0 2px 10px rgba(0, 0, 0, 0.05)',
      padding: '20px',
      display: 'flex',
      alignItems: 'center',
      transition: 'transform 0.3s ease, box-shadow 0.3s ease',
      cursor: 'pointer'
    },
    cardIcon: {
      marginRight: '15px',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      width: '50px',
      height: '50px',
      borderRadius: '50%',
      backgroundColor: 'rgba(59, 130, 246, 0.1)'
    },
    cardContent: {
      flex: '1'
    },
    cardTitle: {
      fontSize: '16px',
      color: '#6b7280',
      margin: '0 0 8px 0',
      fontWeight: '500'
    },
    cardValue: {
      fontSize: '24px',
      fontWeight: '700',
      color: '#1f2937',
      margin: '0'
    },
    cardSubtitle: {
      fontSize: '14px',
      fontWeight: '400',
      color: '#9ca3af',
      marginTop: '4px'
    },
    quickActionsSection: {
      marginBottom: '30px'
    },
    sectionTitle: {
      fontSize: '24px',
      color: '#2c3e50',
      marginBottom: '16px'
    },
    actionsContainer: {
      display: 'flex',
      gap: '20px',
      flexWrap: 'wrap'
    },
    actionBtn: {
      padding: '16px 24px',
      border: '2px solid #8b5cf6',
      backgroundColor: 'white',
      color: '#8b5cf6',
      borderRadius: '8px',
      fontSize: '16px',
      fontWeight: '500',
      cursor: 'pointer',
      transition: 'all 0.3s ease',
      minWidth: '180px',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      gap: '8px'
    },
    expensesBtn: {
      borderColor: '#3b82f6',
      color: '#3b82f6'
    }
  };

  if (loading) {
    return (
      <div style={styles.dashboard}>
        <div style={styles.loadingContainer}>
          <div style={styles.spinner}></div>
        </div>
      </div>
    );
  }

  return (
    <div style={styles.dashboard}>
      <style>
        {`
          @keyframes spin {
            0% { transform: rotate(0deg); }
            100% { transform: rotate(360deg); }
          }
        `}
      </style>
      
      <div style={styles.header}>
        <h1 style={styles.headerTitle}>Member Dashboard</h1>
        <p style={styles.headerSubtitle}>Welcome back! Red Valley Apartment</p>
      </div>

      <div style={styles.welcomeSection}>
        <h3 style={styles.welcomeTitle}>Hello, Resident!</h3>
        <p style={styles.welcomeText}>Manage your contributions and stay updated with community news</p>
      </div>

      <div style={styles.cardsGrid}>
        <div style={styles.card}>
          <div style={styles.cardIcon}>
            <svg width="24" height="24" viewBox="0 0 24 24" fill="#3b82f6">
              <path d="M5,6H23V18H5V6M14,9A3,3 0 0,1 17,12A3,3 0 0,1 14,15A3,3 0 0,1 11,12A3,3 0 0,1 14,9M9,8A2,2 0 0,1 7,10V14A2,2 0 0,1 9,16H19A2,2 0 0,1 21,14V10A2,2 0 0,1 19,8H9M1,10H3V20H19V22H1V10Z"/>
            </svg>
          </div>
          <div style={styles.cardContent}>
            <h3 style={styles.cardTitle}>Monthly Contribution</h3>
            <p style={styles.cardValue}>{formatAmount(stats.monthlyContribution)}</p>
            <p style={styles.cardSubtitle}>Due on 1st of each month</p>
          </div>
        </div>
        
        <div style={styles.card}>
          <div style={styles.cardIcon}>
            <svg width="24" height="24" viewBox="0 0 24 24" fill="#10b981">
              <path d="M12,2A10,10 0 0,0 2,12A10,10 0 0,0 12,22A10,10 0 0,0 22,12A10,10 0 0,0 12,2M12,4A8,8 0 0,1 20,12A8,8 0 0,1 12,20A8,8 0 0,1 4,12A8,8 0 0,1 12,4M11,16.5L6.5,12L7.91,10.59L11,13.67L16.59,8.09L18,9.5L11,16.5Z"/>
            </svg>
          </div>
          <div style={styles.cardContent}>
            <h3 style={styles.cardTitle}>Total Paid</h3>
            <p style={styles.cardValue}>{formatAmount(stats.totalPaid)}</p>
            <p style={styles.cardSubtitle}>This year</p>
          </div>
        </div>
        
        <div style={styles.card}>
          <div style={styles.cardIcon}>
            <svg width="24" height="24" viewBox="0 0 24 24" fill="#f59e0b">
              <path d="M13,13H11V7H13M13,17H11V15H13M12,2A10,10 0 0,0 2,12A10,10 0 0,0 12,22A10,10 0 0,0 22,12A10,10 0 0,0 12,2Z"/>
            </svg>
          </div>
          <div style={styles.cardContent}>
            <h3 style={styles.cardTitle}>Pending Amount</h3>
            <p style={styles.cardValue}>{formatAmount(stats.pendingAmount)}</p>
            <p style={styles.cardSubtitle}>Due this month</p>
          </div>
        </div>
        
        <div style={styles.card}>
          <div style={styles.cardIcon}>
            <svg width="24" height="24" viewBox="0 0 24 24" fill="#ef4444">
              <path d="M14,2H6A2,2 0 0,0 4,4V20A2,2 0 0,0 6,22H18A2,2 0 0,0 20,20V8L14,2M18,20H6V4H13V9H18V20M12,11L8,15H10.5V18H13.5V15H16L12,11Z"/>
            </svg>
          </div>
          <div style={styles.cardContent}>
            <h3 style={styles.cardTitle}>My Complaints</h3>
            <p style={styles.cardValue}>{stats.myComplaints}</p>
            <p style={styles.cardSubtitle}>1 resolved, 2 pending</p>
          </div>
        </div>
        
        <div style={styles.card}>
          <div style={styles.cardIcon}>
            <svg width="24" height="24" viewBox="0 0 24 24" fill="#8b5cf6">
              <path d="M21,19V20H3V19L5,17V11C5,7.9 7.03,5.17 10,4.29C10,4.19 10,4.1 10,4A2,2 0 0,1 12,2A2,2 0 0,1 14,4C14,4.1 14,4.19 14,4.29C16.97,5.17 19,7.9 19,11V17L21,19M14,21A2,2 0 0,1 12,23A2,2 0 0,1 10,21"/>
            </svg>
          </div>
          <div style={styles.cardContent}>
            <h3 style={styles.cardTitle}>Unread Notifications</h3>
            <p style={styles.cardValue}>{stats.unreadNotifications}</p>
            <p style={styles.cardSubtitle}>Latest updates</p>
          </div>
        </div>
        
        <div style={styles.card}>
          <div style={styles.cardIcon}>
            <svg width="24" height="24" viewBox="0 0 24 24" fill="#06b6d4">
              <path d="M19,3H14.82C14.4,1.84 13.3,1 12,1C10.7,1 9.6,1.84 9.18,3H5A2,2 0 0,0 3,5V19A2,2 0 0,0 5,21H19A2,2 0 0,0 21,19V5A2,2 0 0,0 19,3M12,3A1,1 0 0,1 13,4A1,1 0 0,1 12,5A1,1 0 0,1 11,4A1,1 0 0,1 12,3M7,7H17V5H19V19H5V5H7V7Z"/>
            </svg>
          </div>
          <div style={styles.cardContent}>
            <h3 style={styles.cardTitle}>Last Payment</h3>
            <p style={styles.cardValue}>{stats.lastPaymentDate}</p>
            <p style={styles.cardSubtitle}>Paid on time</p>
          </div>
        </div>
      </div>
      
      <div style={styles.quickActionsSection}>
        <h2 style={styles.sectionTitle}>Quick Actions</h2>
        <div style={styles.actionsContainer}>
          <button 
            style={styles.actionBtn}
            onClick={handleViewComplaints}
          >
            <svg width="24" height="24" viewBox="0 0 24 24" fill="#fff">
              <path d="M14,2H6A2,2 0 0,0 4,4V20A2,2 0 0,0 6,22H18A2,2 0 0,0 20,20V8L14,2M18,20H6V4H13V9H18V20Z"/>
            </svg>
            View Complaints
          </button>
          
          <button 
            style={{...styles.actionBtn, ...styles.expensesBtn}}
            onClick={handleViewExpenses}
          >
            <svg width="24" height="24" viewBox="0 0 24 24" fill="#fff">
              <path d="M19,3H14.82C14.4,1.84 13.3,1 12,1C10.7,1 9.6,1.84 9.18,3H5A2,2 0 0,0 3,5V19A2,2 0 0,0 5,21H19A2,2 0 0,0 21,19V5A2,2 0 0,0 19,3M12,3A1,1 0 0,1 13,4A1,1 0 0,1 12,5A1,1 0 0,1 11,4A1,1 0 0,1 12,3M7,7H17V5H19V19H5V5H7V7Z"/>
            </svg>
            View Expenses
          </button>
          
          <button 
            style={styles.actionBtn}
            onClick={handleViewNotifications}
          >
            <svg width="24" height="24" viewBox="0 0 24 24" fill="#fff">
              <path d="M21,19V20H3V19L5,17V11C5,7.9 7.03,5.17 10,4.29C10,4.19 10,4.1 10,4A2,2 0 0,1 12,2A2,2 0 0,1 14,4C14,4.1 14,4.19 14,4.29C16.97,5.17 19,7.9 19,11V17L21,19M14,21A2,2 0 0,1 12,23A2,2 0 0,1 10,21"/>
            </svg>
            View Notifications
          </button>
        </div>
      </div>
    </div>
  );
};

export default MemberDashboard;
